class BrandService
{
    getBrands = ()=>{
        return fetch("http://localhost:8989/api/brand/list")
    }

    saveBrand= (data)=>{
        return fetch("http://localhost:8989/api/brand/bsave",{
            method : "POST",
            headers:{
                "Content-Type" : "application/json"
            },
            body : JSON.stringify(data)
